package top.jacktu.page.bean;import java.io.Serializable;public class UserMsg implements Serializable {	private static final long serialVersionUID = 1369424127391094146L;	private String leave_name;	private String leave_msg;	public String getLeave_name() {		return this.leave_name;	}	public void setLeave_name(String leave_name) {		this.leave_name = leave_name;	}	public String getLeave_msg() {		return this.leave_msg;	}	public void setLeave_msg(String leave_msg) {		this.leave_msg = leave_msg;	}}